import { Container } from "react-bootstrap";
import Image from 'react-bootstrap/Image'
function HomeBanner(){

    return (
        <Container fluid>
            <div className="bannerImgDiv">
               <Image src="banner.png" roundedCircle>

               </Image>
            </div>
        </Container>
    );

}

export default HomeBanner;
